jQuery(document).ready(function(t){t('input[type="search"]').on("search keyup",function(e){if(typeof t(this).data("list")=="undefined"){return}var i=t(this).val().toLowerCase(),s=t(this).data("list");if(i.length==0){t("li",t(s)).show();return}t("li",t(s)).each(function(){if(t(this).text().toLowerCase().search(i)>-1){t(this).show()}else{t(this).hide()}})})});